import React from 'react'
import CategoriesLink from './CategoriesLink.js'
import './Sidebar.css'

export default class CategoriesDiv extends React.Component {
    render() {

        let categoriesArray = this.props.articles.map(function (article) {
            return article['categories']
        });
        console.log(categoriesArray)

        let categoriesFiltered = categoriesArray.map(function (category) {
            return category[""]
        });
        console.log(categoriesFiltered)

        return (
            <div id="categoriesDiv">
                {categoriesFiltered.map(function (category) {
                    return <CategoriesLink key={category} category={category} />
                })}
            </div>
        );
    }
}
